signed main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    cout.tie(nullptr);

//    P1 = random_key(256, M1);
//    P2 = random_key(256, M2);
//    cout << P1 << ' ' << P2 << endl;

    string a;
    cin >> a;
    int n = a.size();
    a = a + a;

    vector<pair<int, int>> h_a;
    init_pow();
    build_hash(a, h_a);

    vector<int> pos;
    pos.reserve(n);
    for (int i = 0; i < n; ++i) {
        pos.emplace_back(i);
    }

    stable_sort(pos.begin(), pos.end(), [&] (const int p1, const int p2) {
        int l = 0, r = n + 1;
        while (r - l > 1) {
            int mid = (r + l) / 2;
            if (get_hash(h_a, p1, mid, 2 * n) == get_hash(h_a, p2, mid, 2 * n)) {
                l = mid;
            } else {
                r = mid;
            }
        }
        return l < n && a[p1 + l] < a[p2 + l];
    });

    string ans;
    int p;

    for (int i = 0; i < pos.size(); ++i) {
        if (pos[i] == 0) {
            p = i;
        }
        ans += a[pos[i] + n - 1];
    }
    cout << p + 1 << '\n' << ans << '\n';

}

