export const DropDownWithMultiEditor = forwardRef((p: ICustomEditorProps, ref) => {
  useInjectSagaImmediately({ key: 'waitForSetFormDataSaga', saga: waitForSetDataSaga, mode: DAEMON });

  const [gridDataSource, setGridDataSource] = useState([]);
  const [gridBoxValue, setGridBoxValue] = useState([]);
  const dropDownRef = useRef(null);
  const [currentClass, setCurrentClass] = useState(p.outerOptions['F_Gia___F_1___C_Variant']);
  const dispatch = useDispatch();

  QueryBuilder.token = getToken();
  QueryBuilder.url = JSON_RPC_URL;

  const formatAndSetData = data => {
    const datasource = data.map(el => {
      return {
        ID: el.id,
        [variantTitle]: el.c_variant,
      };
    });
    setGridDataSource(datasource);
  };

  useEffect(() => {
    if (p.dataField === 'C_Gia_3') {
      dispatch({ type: 'update_gia_3_source', path: p.outerOptions.path, method: cancelMethodName });
    }
  }, []);

  const getData = async (type: string) => {
    const qb = QueryBuilder.setTable('Domain.Apps_CD_Answers')
      .setCols(['id', 'c_variant'])
      .setFilter(QueryFilterProxy(`C_Type=${type}`));
    const res = await qb.exec('get');
    if (Array.isArray(res) && res.length > 0) {
      res.sort((a, b) => a.c_variant.localeCompare(b.c_variant));
      formatAndSetData(res);
    }
  };

  useEffect(() => {
    console.log(p.dataField);
  }, []);

