      case 'C_Gia_4':
        type = 'gia_4';
        break;
      case 'C_Gia_5':
        type = 'gia_5';
        break;
      case 'C_Gia_6':
        type = 'gia_6';
        break;
      case 'C_Gia_7':
        type = 'gia_7';
        break;
      case 'C_Gia_8':
        type = 'gia_8';
        break;
      case 'C_Gia_9':
