    }

    if (p.dataField === 'C_Gia_3') {
      type = p.outerOptions.formData['C_Calc_Class'] === '9' ? 'gia_3_9' : 'gia_3_11';
    }

    void getData(type);
  }, []);

  const dataGridOnSelectionChanged = e => {
