    innerDiv3.classList.add('d-flex', 'flex-column', 'ms-2');

    const lastMessageDateParagraph = document.createElement('p');
    lastMessageDateParagraph.classList.add('patient-lastMessageDate', 'mb-1');
    lastMessageDateParagraph.textContent = lastMessageTime;

    innerDiv3.appendChild(lastMessageDateParagraph);
    if (unreadMessages) {
        const unreadMessageParagraph = document.createElement('p')
        unreadMessageParagraph.classList.add('mb-0', 'd-flex', 'rounded-circle', 'align-items-center', 'justify-content-center', 'patient-newMessageNumber')
        unreadMessageParagraph.textContent = unreadMessages.toString()
        innerDiv3.appendChild(unreadMessageParagraph);
    }

    mainDiv.appendChild(innerDiv3);

    chatDiv.appendChild(mainDiv);
}

function formatDate(date) {
    const now = new Date();
    const timeDiff = now - date;

    const minute = 60 * 1000;
    const hour = 60 * minute;
    const day = 24 * hour;
    const week = 7 * day;

    if (timeDiff < minute) {
        return "Ostatnio teraz";
    } else if (timeDiff < hour) {
        const minutesAgo = Math.floor(timeDiff / minute);
        return `Ostatnio ${minutesAgo} minut${minutesAgo === 1 ? 'a' : ''} temu`;
    } else if (timeDiff < day) {
        const hoursAgo = Math.floor(timeDiff / hour);
        return `Ostatnio ${hoursAgo} godzin${hoursAgo === 1 ? 'a' : ''} temu`;
    } else if (timeDiff < week) {
        const dayOfWeek = ["Niedziela", "Poniedziałek", "Wtorek", "Środa", "Czwartek", "Piątek", "Sobota"];
        const dayIndex = date.getDay();
        const formattedTime = `${dayOfWeek[dayIndex]} o ${formatTime(date)}`;
        return `Ostatnio ${formattedTime}`;
    } else {
        return `Ostatnio ${formatDateWithYear(date)}`;
    }
}

function formatTime(date) {
    const hours = String(date.getHours()).padStart(2, '0');
    const minutes = String(date.getMinutes()).padStart(2, '0');
    return `${hours}:${minutes}`;
}

function formatDateWithYear(date) {
    const dayOfMonth = String(date.getDate()).padStart(2, '0');
    const month = [
        "stycznia", "lutego", "marca", "kwietnia", "maja", "czerwca",
        "lipca", "sierpnia", "września", "października", "listopada", "grudnia"
    ][date.getMonth()];
    const year = date.getFullYear();
    return `${date.getDay()}, ${dayOfMonth} ${month} ${year}`;
}

function formatDateToCustomString(date) {
    const daysOfWeek = ["Niedziela", "Poniedziałek", "Wtorek", "Środa", "Czwartek", "Piątek", "Sobota"];
    const months = ["stycznia", "lutego", "marca", "kwietnia", "maja", "czerwca", "lipca", "sierpnia", "września", "października", "listopada", "grudnia"];

    const dayOfWeek = daysOfWeek[date.getDay()];
    const dayOfMonth = String(date.getDate()).padStart(2, "0");
    const month = months[date.getMonth()];
    const year = date.getFullYear();
    const hours = String(date.getHours()).padStart(2, "0");
    const minutes = String(date.getMinutes()).padStart(2, "0");

    return `${dayOfWeek}, ${dayOfMonth} ${month} ${year}, ${hours}:${minutes}`;
}

const createMessageElement = (message, sendBySelf, messageDate) => {
    const parsedDate = new Date(messageDate.slice(0, -5))
    const hour = `${parsedDate.getHours()}:${parsedDate.getMinutes()}`
    const messageBox = document.createElement('div');
    messageBox.classList.add('message-box')
    if (sendBySelf) {
        messageBox.classList.add('user')
    }

    const messageEl = document.createElement('div')
    messageEl.classList.add('message', 'rounded-3')

    const messageContent = document.createElement('p')
    messageContent.classList.add('lx-caption-2', 'mb-0')
    messageContent.textContent = message;
    messageEl.appendChild(messageContent);

    const messageDateEl = document.createElement('p')
    messageDateEl.classList.add('lx-caption-2', 'mt-2', 'message-date')
    messageDateEl.textContent = hour

    messageBox.appendChild(messageEl)
    messageBox.appendChild(messageDateEl)

    messagesDiv.appendChild(messageBox)
}

const createMessageTimeStampElement = (date) => {
    const chatDate = document.createElement('div');
    chatDate.classList.add('chat-date', 'mt-2', 'mb-4');

    const rowDiv = document.createElement('div');
    rowDiv.classList.add('row', 'mx-0');

    const col1 = document.createElement('div');
    col1.classList.add('col-4');

    const hr1 = document.createElement('hr');
    col1.appendChild(hr1);

    const col2 = document.createElement('div');
    col2.classList.add('col-4');

    const chatDateText = document.createElement('p');
    chatDateText.classList.add('text-center', 'mt-1', 'mb-0');
    chatDateText.textContent = formatDateToCustomString(date);
    col2.appendChild(chatDateText);

    const col3 = document.createElement('div');
    col3.classList.add('col-4');

    const hr2 = document.createElement('hr');
    col3.appendChild(hr2);

// Tworzenie hierarchii elementów
    rowDiv.appendChild(col1);
